    RS_FUNC rs_func = new RS_FUNC("FUNC" + generateLabel());
    RS_ID rs_id = (RS_ID) pilaSemantica.pop();

    ts.insertarFuncion(new Simbolo("FUNCION", rs_id.getId().toString(), "Se cae", "global"));

    pilaSemantica.push(rs_func);
